const fetchBlog = async ({ slug }: { slug: string }) => {
  const res = await fetch(
    `${process.env.NEXT_PUBLIC_BACK_END_URL}/api/v1/blog/slug/${slug}`,
    {
      cache: "no-store",
    }
  );
  const data = await res.json();
  return data;
};

